import { TextField, ShoppingCartRounded } from '@mui/material';

export default function Form() {
    return (
        <div className="">
            <TextField variant="standard" label="Username" />
            <Button variant="outlined" startIcon={<ShoppingCartRounded />}>
    Add to Cart
  </Button>
        </div>
    );
}
